import { useLocation } from 'react-router-dom';
import logo from './coin-back.svg';

function Game() {
    const location = useLocation()
    const { name, bet, side } = location.state;

    console.log(name, bet, side);

    return (
        <img id="coin-back" src={logo} alt="coin" />
    );
}

export default Game;
